INSERT INTO `wp_options` VALUES (2075,'wppb_content_restriction_settings','a:7:{s:18:\"contentRestriction\";s:3:\"yes\";s:13:\"restrict_type\";s:7:\"message\";s:12:\"redirect_url\";s:0:\"\";s:18:\"message_logged_out\";s:1060:\"[wpv-post-title output=\"sanitize\"]\r\n\r\n[wpv-post-excerpt length=\"20\" count=\"word\"]\r\n\r\n&nbsp;\r\n\r\n<strong><a href=\"http://159.203.3.222/register/\">Register</a>or<a href=\"http://159.203.3.222/home/log-in/\">sign in</a>to access the Embedded Vision Academy\'s free technical training content.</strong>\r\n\r\nThe training materials provided by the Embedded Vision Academy are offered free of charge to everyone. All we ask in return is that you register, and tell us a little about yourself so that we can understand a bit about our audience. As detailed in our<a href=\"http://159.203.3.222/privacy/\" target=\"_blank\" rel=\"noopener\">Privacy Policy,</a>we will not share your registration information, nor contact you, except with your consent.\r\n\r\nRegistration is free and takes less than one minute.<a href=\"http://159.203.3.222/register/\">Click here to register</a>, and get full access to the Embedded Vision Academy\'s unique technical training content.\r\n\r\nIf you\'ve already registered,<a href=\"http://159.203.3.222/home/log-in/\">click here to sign in.</a>\";s:17:\"message_logged_in\";s:46:\"This content is restricted for your user role.\";s:12:\"post_preview\";s:12:\"trim-content\";s:19:\"post_preview_length\";s:2:\"20\";}','yes');
